import React from 'react';
import * as ReactIcons from 'react-icons/fa';
import CategoryIcon from './styles';

// category icons
export default {
  expense: {
    bar_restaurants: <ReactIcons.CategoryIcon as={FaGlassMartiniAlt} />,
    clothing: <ReactIcons.FaTshirt />,
    debts_loans: <ReactIcons.FaReceipt />,
    education: <ReactIcons.FaUserGraduate />,
    entertainment_hobbies: <ReactIcons.FaSmile />,
    familly_children: <ReactIcons.FaHeart />,
    food: <ReactIcons.FaUtensils />,
    groceries: <ReactIcons.FaShoppingCart />,
    health: <ReactIcons.FaMedkit />,
    home: <ReactIcons.FaHome />,
    investments: <ReactIcons.FaChartLine />,
    others: <ReactIcons.FaList />,
    personal_care: <ReactIcons.FaUser />,
    pets: <ReactIcons.FaPaw />,
    shopping: <ReactIcons.FaShoppingBag />,
    subscriptions_services: <ReactIcons.FaPrint />,
    taxes: <ReactIcons.FaPercentage />,
    transportation: <ReactIcons.FaBus />,
    travel: <ReactIcons.FaPlane />,
  },
  earnings: {
    salary: <ReactIcons.FaStar />,
    loan: <ReactIcons.FaDollarSign />,
    investments: <ReactIcons.FaChartLine />,
    other_earnings: <ReactIcons.FaEllipsisH />,
  },
};
